import React, { useState, useRef } from "react";

import '../../../../styles/shared/main.css';
import '../../../../styles/main/student/search/Search.css';
import Navbar from "../../general/navbar/Navbar";
import ReviewListItem from "../../coder/reviews/ReviewListItem";
import {Link} from "react-router-dom";
import ReviewEditor from "../../coder/reviews/ReviewEditor";

const Search = () => {


    //todo check if user is logged in






    return (
        <div className="center_container">
            <Navbar />
            <div className="main_center_content_wrapper">
                <div className="main_outer_content">
                    <div className="main_outer_heading">Student reviews</div>
                </div>
                <div className="main_center_content">
                    {
                        uploads.length > 0 ? (
                            <div className="review_list_container">
                                <div className="review_list_heading">
                                    <div className="large_list_field">Titel</div>
                                    <div className="small_list_field">Anzahl Reviews</div>
                                    <div className="small_list_field">Neue Vorschl√§ge</div>
                                    <div className="small_list_field">Datum</div>
                                </div>
                                {uploads.map((upload, index) => <ReviewListItem data = {upload} index = {index} extView = {showExtReview}/>)}
                            </div>
                        ) : (
                            <Link to={"/coder/editor/"} className="empty_review_msg">Du hast noch nichts hochgeladen - Fange jetzt damit an</Link>
                        )
                    }
                    { visibleReview && <ReviewEditor /> }
                </div>
                <div className="main_outer_content right_bound_outer_content"></div>
            </div>
        </div>
    );
};

export default Search;
